With $x=8$:  \begin{align*}
y &= \frac{1}{4}f\left(\frac{1}{2}\cdot 8\right) \\
&= \frac{1}{4}f(4) \\
&= \frac{1}{4}\cdot \frac{1}{4}f(4) \\
&= \frac{1}{16}f(4)
\end{align*}
Since $(8,8)$ lies on the graph of $y=f(x)$, we know that $f(4)=8$. 
Therefore \begin{align*}
y &= \frac{1}{16}f(4) \\
&= \frac{1}{16}8 \\
&= \boxed{\frac{1}{2}}
\end{align*}
So the point $(x,y)=\left(4,\frac{1}{2}\right)$ will be on the graph of $y=f(x)$.
Therefore, the sum of the coordinates of that point is $4+\frac{1}{2}=\boxed{\frac{9}{2}}$.
